import React from "react";
import { Card } from "react-bootstrap";

function productscreen({ product }) {
  return (
    <>
      <Card className="my-3 p-3 rounded">
        <a href={`/product/${product._id}`}>
          <Card.Img></Card.Img>
        </a>
      </Card>
    </>
  );
}

export default productscreen;
